    "2015-07-23T03:28:31.797300",nt"name": "supplement-to-land-use-plan",nt"isopen":
    false,nt"url": null,nt"notes": "This document outlines the various land
    uses at Tewaukon National Wildlife Refuge. The grasslands on the Tewaukon Wildlife
    Refuge will be used for grazing to the extent that it will not detract from their
    value as nesting places for waterfowl. This document contains vegetative surveys
    of representative grazing units and maps that outline the various land uses of different
    land parcels. These land uses include cropping, mulching, grazing, wetland development,
    farmstead windbreaks, field windbreaks, range use, and habitat preservation. Land
    management guides are included for gray partridges, muskrat, geese, ducks, mink,
    pheasant, and deer.",nt"license_title": "License Not Specified",nt"extras":
